import React, { Component } from 'react';
import Child from './child';

class Parent extends Component {
  constructor(props) {
    super(props);

    this.state = {
      parentMessage: 'Dad',
    };
  }

  greetParent = (value) => {
    alert(`Hello ${this.state.parentMessage} ${value}`);
  };

  helloBolo = () => {};

  render() {
    return (
      <div>
        <Child funcAsProp={this.greetParent} />
      </div>
    );
  }
}

export default Parent;
